import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Tweet() {
  return (
    <div className='tweet'>
       Tweet
    </div>
  );
}

function Avatar() {
  return (
    <img
      src='https://www.gravatar.com/avatar/nothing'
      className='avatar'
      alt='avatar'
    />
  );
}

ReactDOM.render(<Tweet />, document.getElementById('root'));
